import React from "react";
import { Routes, Route } from "react-router-dom";

import ChooseLogin from "../components/login/chooseLogin";
import StudentLogin from "../components/studentPages/login/student";
import AdminLogin from "../components/adminPages/login/admin";
import AdminSignup from "../components/adminPages/signup/admin";
import ReDirectRoute from "./reDirectRoute";

const LoginRoutes = () => {

    return (
        <Routes>
            <Route path="*" element={<div>Page not found</div>}/>
            <Route path="/" element={<ReDirectRoute />} />
            <Route path="/chooseLogin" element={<ChooseLogin />} />
            <Route path="/studentLogin" element={<StudentLogin />} />
            <Route path="/adminLogin" element={<AdminLogin />} />
            <Route path="/adminSignup" element={<AdminSignup />} />
        </Routes>
    );
}

export default LoginRoutes;
